import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProductGrid from './components/ProductGrid';
import ProductDetails from './components/ProductDetails';
import Cart from './components/Cart';
import CheckoutForm from './components/CheckoutForm';
import Receipt from './components/Receipt';
import SnowFall from './components/GlobalSnow';
import Navbar from './components/Navbar';
import { Cart as CartType, Receipt as ReceiptType } from './types';
import './App.css';

const App: React.FC = () => {
  const [cart, setCart] = useState<CartType>({ items: [], total: 0 });
  const [receipt, setReceipt] = useState<ReceiptType | null>(null);

  const refreshCart = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/cart');
      const cartData = await response.json();
      setCart(cartData);
    } catch (error) {
      console.error('Error fetching cart:', error);
    }
  };

  return (
    <Router>
      <div className="App">
        {/* Snow Fall Effect */}
        <SnowFall />

        {/* Navigation Bar */}
        <Navbar cart={cart} onCartUpdate={refreshCart} />

        <main className="app-main">
          <Routes>
            <Route path="/" element={<ProductGrid onCartUpdate={refreshCart} />} />
            <Route path="/products" element={<ProductGrid onCartUpdate={refreshCart} />} />
            <Route path="/deals" element={<ProductGrid onCartUpdate={refreshCart} />} />
            <Route path="/categories" element={<ProductGrid onCartUpdate={refreshCart} />} />
            <Route path="/category/:category" element={<ProductGrid onCartUpdate={refreshCart} />} />
            <Route path="/product/:productId" element={<ProductDetails onCartUpdate={refreshCart} />} />
            <Route path="/cart" element={
              <div className="cart-section">
                <Cart cart={cart} onCartUpdate={refreshCart} />
                {cart.items.length > 0 && (
                  <button 
                    className="checkout-btn"
                    onClick={() => window.location.href = '/checkout'}
                  >
                    Proceed to Checkout
                  </button>
                )}
              </div>
            } />
            <Route path="/checkout" element={
              <CheckoutForm 
                onBack={() => window.location.href = '/cart'}
                onSuccess={(receipt) => {
                  setReceipt(receipt);
                  refreshCart();
                }}
              />
            } />
            {/* Add placeholder pages */}
            <Route path="/about" element={<div className="container"><h1>About Us ðŸŽ…</h1><p>Coming soon...</p></div>} />
            <Route path="/contact" element={<div className="container"><h1>Contact ðŸ“ž</h1><p>Coming soon...</p></div>} />
          </Routes>
        </main>

        {receipt && (
          <Receipt 
            receipt={receipt}
            onClose={() => {
              setReceipt(null);
              window.location.href = '/';
            }}
          />
        )}
      </div>
    </Router>
  );
};

export default App;
